def test_pyvista(vertices):
    vertices_top_bottom = []
    height = 2
    for vertex in vertices:
        if len(vertex) < 3:
            z = 0
        else:
            z = vertex[2]
        vertices_top_bottom += [[vertex[0], vertex[1], z], [vertex[0], vertex[1], z + height]]

    #side_faces = create_side_faces(vertices_top_bottom)


    lower_face = [0]
    upper_face = [0]
    side_faces = []
    for i in range(len(vertices_top_bottom)):

        if i % 2 == 0:
            lower_face.append(i)
        else:
            upper_face.append(i)
        if i >= 2:
            side_faces.extend([3, i - 2, i - 1, i])

    lower_face[0] = len(lower_face) -1 
    upper_face[0] = len(upper_face) -1
    mesh = pv.PolyData(vertices_top_bottom, [lower_face, upper_face])
    mesh = mesh.merge(pv.PolyData(vertices_top_bottom, side_faces))

    return mesh

full_mesh = pv.PolyData()

for vertices in example_vertices:
    full_mesh = full_mesh.merge(test_pyvista(vertices))

full_mesh = full_mesh.triangulate()

plotter = pv.Plotter()
actor = plotter.add_mesh(full_mesh)
actor = plotter.show_bounds(
    grid='front',
    location='outer',
    all_edges=True
)
plotter.show()
